import personService from './services/persons'

const Person = (props) => {
  const deletePerson = (id) => {
    personService 
      .removePerson(id)
  }

  const {personObject} = props
  return (
    <div>
      <div>{personObject.name} {personObject.number}</div>
      <Button handleClick={deletePerson} label='delete'/>
    </div>
  )
}

const Button = (props) => <button onClick={props.handleClick}>{props.label}</button>

const FilteredList = (props) => {
  const {filteredPeople} = props
  return (
    <div>
      {filteredPeople.map(person =>
        <Person key={person.name} personObject={person}/>
      )}
    </div>
  )
}

export default FilteredList
